DECLARE @DATA TABLE (BF_SSN VARCHAR(9), AF_APL_ID VARCHAR(20), AF_APL_ID_SFX VARCHAR(5))

SELECT DISTINCT 
	LD_CLM_ASN_DOE,
	LC_REA_CLM_ASN_DOE,
	* 
FROM 
	@DATA D
	INNER JOIN ODW..DC01_LON_CLM_INF DC01
		ON DC01.BF_SSN = D.BF_SSN
		AND DC01.AF_APL_ID = D.AF_APL_ID
		AND DC01.AF_APL_ID_SFX = D.AF_APL_ID_SFX
	INNER JOIN 
	(
		SELECT DISTINCT
			DC01.BF_SSN,
			DC01.AF_APL_ID,
			DC01.AF_APL_ID_SFX,
			MAX(DC01.LF_CRT_DTS_DC10) AS MaxDate
		FROM
			ODW..DC01_LON_CLM_INF DC01
		GROUP BY
			DC01.BF_SSN,
			DC01.AF_APL_ID,
			DC01.AF_APL_ID_SFX
	) DC01M
		ON DC01.AF_APL_ID = DC01M.AF_APL_ID
		AND DC01.AF_APL_ID_SFX = DC01M.AF_APL_ID_SFX
		AND DC01.LF_CRT_DTS_DC10 = DC01M.MaxDate
--WHERE
--	LC_REA_CLM_ASN_DOE != '08'